function run(data) {
    /** @type {DataForScript} */
    const dd = data

    /**
     * @param ui {number}
     * @param uri {string}
     */
    function addTag(ui, uri) {
        const path = dd.vendor.pathManager.findByUN(uri)
        if (path === undefined) {
            return
        }

        path.operationManager.list.forEach(item => {
            if (item.tagManager.find(ui)) {
                return
            }
            const one = item.tagManager.make(ui)
            item.tagManager.add(one)
        })
    }

    const tag = dd.vendor.tagManager.findOrMake(dd.schema.un)
    addTag(tag.ui, '/' + dd.schema.snakeCase)
    addTag(tag.ui, '/' + dd.schema.snakeCase + '/{id}')
}

